function fillColor(s){ return (s === 'ÌôúÏÑ±Ìôî') ? '#20a120' : '#e23b3b'; }
function styleFn(status){
  return function(f){
    return { color: '#444', weight: 1.5, fillColor: fillColor(status), fillOpacity: (status==='ÌôúÏÑ±Ìôî') ? 0.35 : 0.25 };

var onLayer = L.geoJSON(null, { style: styleFn('ÌôúÏÑ±Ìôî'), onEachFeature: onEach });
var offLayer = L.geoJSON(null, { style: styleFn('ÎπÑÌôúÏÑ±Ìôî'), onEachFeature: onEach });

function onEach(feature, layer){
  var p = feature.properties || {};
  var name = p.EMD_NM || '';
  var code = p.EMD_CD || '';
  var status = p.status || '';
  var html = '<div><b>'+name+'</b> ('+code+')<br/>ÏÉÅÌÉú: '+status+'</div>';
  layer.bindTooltip('<b>'+name+'</b>', {permanent:true, direction:'center', className:'label'});
  layer.bindPopup(html);
}

(DATA.features || []).forEach(function(ft){
  var s = (ft.properties && ft.properties.status) || 'ÎπÑÌôúÏÑ±Ìôî';
